class Solution {
    public int longestOnes(int[] A, int K) {
//        long start = System.currentTimeMillis();
        int maxN = 0;
        int currN = 0;

        TreeSet<Integer> index = new TreeSet<>();
        for (int i = 0; i < A.length; i++) {

            if (K == 0 && A[i] == 0) {
                maxN = Math.max(maxN, currN);
                currN = 0;
            }

            // K > 0
            if (A[i] == 0 && index.size() < K) {
                index.add(i);
                currN++;
                continue;
            }


            if (A[i] == 0 && index.size() == K && K > 0) {
                int cutBefore = 0;
                int appendAfter = 0;
                Integer first = index.first();
                while (first >= 0 && (A[first] == 1 || index.contains(first))) {
                    cutBefore++;
                    first--;
                }
                int j = i;
                while (j < A.length && (j == i || A[j] == 1)) {
                    appendAfter++;
                    j++;
                }

                index.pollFirst();
                index.add(i);
                currN = currN - cutBefore + appendAfter;
                if (A[index.first() - 1] == 0) {
                    currN = index.last() - index.first() + 1 + appendAfter - 1;
                }

                maxN = Math.max(maxN, currN);

                first = cutBefore >= 2 ? (first + 1) : first;
                j = j > i ? j : i + 1;
                while (j <= A.length - 1 && A[j] == 0) {
                    index.add(j);
                    int first1 = index.pollFirst();
                    first = first1 + 1;
                    currN = j - first + 1;
                    j++;
                }
                i = j - 1;

                continue;
            }

            if (A[i] == 1) {
                currN++;
                maxN = Math.max(maxN, currN);
                continue;
            }

        }

//         System.out.println("time:" + (System.currentTimeMillis() - start));
        return Math.max(maxN, currN);
    }
}

